import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/DetalhesImovel.css";
import verifyIcon from "../assets/images/Verify.png";

const DetalheImovel = () => {
  const navigate = useNavigate();

  const handleSell = () => {
    navigate("/comprador");
  };

  return (
    <div className="detalhe-imovel">
      <div className="header">
        <h1>Imóvel</h1>
        <div className="status">
          <img src={verifyIcon} alt="Verificado" className="verify-icon" />
          <span>À VENDA</span>
        </div>
      </div>

      {/* Dados do Imóvel */}
      <h3>Dados do Imóvel</h3>
      <form>
        <div>
          <input type="text" value="Brasil" readOnly />
          <input type="text" value="Paraíba" readOnly />
          <input type="text" value="Cajazeiras" readOnly />
        </div>
        <div>
          <input type="text" value="200 m²" readOnly />
          <input type="text" value="2" readOnly />
          <input type="text" value="Residencial" readOnly />
        </div>
      </form>

      {/* Proprietário */}
      <h3>Proprietário</h3>
      <form>
        <div>
          <input type="text" value="Lamark Ricarte" readOnly />
          <input type="email" value="lamark@gmail.com" readOnly />
        </div>
        <div>
          <input type="text" value="00/00/0000" readOnly />
          <input type="text" value="83999999999" readOnly />
        </div>
        <div>
          <input type="text" value="Brasil" readOnly />
          <input type="text" value="Paraíba" readOnly />
          <input type="text" value="Cachoeira dos Índios" readOnly />
        </div>
      </form>

      <button onClick={handleSell}>Vender - adicionar dados do comprador</button>
    </div>
  );
};

export default DetalheImovel;
